import { ForceGraph2D } from 'react-force-graph';
import mindMapData from './helenKellaMindMap';

const convertToGraphFormat = (data) => {
  const nodes = [];
  const links = [];
  let idCounter = 0;

  const walk = (node, parent = null) => {
    const currentId = idCounter++;
    nodes.push({ id: currentId, name: node.name || node });
    if (parent !== null) links.push({ source: parent, target: currentId });
    if (node.children && node.children.length) {
      node.children.forEach((child) => {
        if (typeof child === 'string') {
          nodes.push({ id: idCounter, name: child });
          links.push({ source: currentId, target: idCounter++ });
        } else {
          walk(child, currentId);
        }
      });
    }
  };

  walk(data);
  return { nodes, links };
};

const HelenKellaMindMap = () => {
  const graphData = convertToGraphFormat(mindMapData);

  return (
    <div style={{ width: '100vw', height: '100vh', background: '#000' }}>
      <ForceGraph2D
        graphData={graphData}
        nodeLabel={(node) => node.name}
        nodeAutoColorBy="id"
        nodeCanvasObject={(node, ctx, globalScale) => {
          const label = node.name;
          const fontSize = 12 / globalScale;
          ctx.font = `${fontSize}px Sans-Serif`;
          ctx.fillStyle = '#f0f0f0';
          ctx.shadowColor = '#0ff';
          ctx.shadowBlur = 8;
          ctx.textAlign = 'center';
          ctx.fillText(label, node.x, node.y);
        }}
        linkColor={() => '#555'}
        backgroundColor="#000"
      />
    </div>
  );
};

export default HelenKellaMindMap;"
}

